import React from "react";
import { render } from "react-dom";
import { BrowserRouter, Route, Switch, withRouter } from "react-router-dom";
import axios from "axios";

import Home from "./Home";

import Program from "./Program";
import Dashboard from "./Dashboard";
import Evest from "./Evest";
import Plans from "./Plans";
import Profile from "./Profile";
import SingleHome from "./SingleHome";
import SingleLand from "./SingleLand";


// Define App URL
axios.defaults.baseURL = 'https://api.adeniyiogunwuyi.com/api/v1';
// axios.defaults.baseURL = 'http://localhost:8000/api/v1';

class App extends React.Component {
  render() {
    return (
          <Switch data="data">
            <div id="main">
                  <Route exact path="/" component={Home}/>
                  <Route exact path="/dashboard" render={props => (<Dashboard {...props}/>)}/>
                  <Route exact path="/evest" render={props => (<Evest {...props}/>)}/>
                  <Route exact path="/my-plans" render={props => (<Plans {...props}/>)}/>
                  <Route exact path="/my-account" render={props => (<Profile {...props}/>)}/>
                  <Route exact path="/view-home" render={props => (<SingleHome {...props}/>)}/>
                  <Route exact path="/view-land" render={props => (<SingleLand {...props}/>)}/>
                  <Route exact path="/funeral-program" render={props => (<Program {...props}/>)}/>
            </div>
          </Switch>
    );
  }
}

const AppContainer = withRouter(props => <App {...props} />);
// console.log(store.getState())
render(
  <BrowserRouter>
    <AppContainer />
  </BrowserRouter>,

  document.getElementById("root")
);
